import createReactComponent from '../createReactComponent';
var Clock8 = createReactComponent('Clock8', [['circle', {
  cx: '12',
  cy: '12',
  r: '10',
  key: '1mglay'
}], ['polyline', {
  points: '12 6 12 12 8 14',
  key: 'tmc9b4'
}]]);
export default Clock8;
